let seconds=segundos=Digital.getSeconds()

    var dn="pm"
    if (hours<12)
        dn="am"

    if (hours>12)
        hours=hours-12

    if (hours==0)
        hours=12

    if (minutes<=9)
        minutes="0"+minutes
    
    if (seconds<=9)
        seconds="0"+seconds
    //change font size here to your desire
